function cityChange(){if($("#citylist option:selected").val()==0)$("#countylist-box").hide();else{$("#countylist-box").show();var n=$("#citylist option:selected").val();fillCountyList(n,0)}}function fillCountyList(n,t){$.ajax({type:"GET",url:"/app/county/getallbycity?cityId="+n,success:function(n){$("#countylist").empty();var i=document.getElementById("AddOrEditModalCountySelectionText").value;$("#countylist").append($('<option disabled value="0">'+i+"<\/option>"));$.each(n.data,function(n,t){$("#countylist").append($('<option value="'+t.id+'">'+t.name+"<\/option>"))});$("#countylist option:eq("+t+")").prop("selected",!0)},error:function(n){console.log(n)}})}$(document).ready(function(){$("[data-mask]").inputmask();$(".select2").select2({theme:"bootstrap4",language:document.getElementById("ActiveLanguage").value.substring(0,2)});$("#user-birthdate").datetimepicker({icons:{time:"far fa-clock"},locale:document.getElementById("ActiveLanguage").value})});